import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 59.1-92.20 Fees to cover expense of regulation.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/59.1-92.20.md","filePath":"vacode/59.1-92.20.md"}'),o={name:"vacode/59.1-92.20.md"},s=r('<h1 id="§-59-1-92-20-fees-to-cover-expense-of-regulation" tabindex="-1">§ 59.1-92.20 Fees to cover expense of regulation. <a class="header-anchor" href="#§-59-1-92-20-fees-to-cover-expense-of-regulation" aria-label="Permalink to &quot;§ 59.1-92.20 Fees to cover expense of regulation.&quot;">​</a></h1><p>The fees paid into the state treasury under this chapter, except for fees and funds collected for the Literary Fund, shall be deposited into a special fund and specifically accounted for and used by the Commission to defray the costs of supervising, implementing, and administering the provisions of this chapter, Chapters 5 (§ <a href="http://law.lis.virginia.gov/vacode/13.1-501/" target="_blank" rel="noreferrer">13.1-501</a> et seq.) and 8 (§ <a href="http://law.lis.virginia.gov/vacode/13.1-557/" target="_blank" rel="noreferrer">13.1-557</a> et seq.) of Title 13.1, and Chapter 7 (§ <a href="http://law.lis.virginia.gov/vacode/59.1-93/" target="_blank" rel="noreferrer">59.1-93</a> et seq.) of this title. Included in the Commission&#39;s costs shall be a reasonable margin in the nature of a reserve fund. All excesses of fees collected exceeding these costs shall revert to the general fund.</p><p>1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0819" target="_blank" rel="noreferrer">819</a>.</p>',3),n=[s];function i(l,c,d,f,h,p){return t(),a("div",null,n)}const u=e(o,[["render",i]]);export{g as __pageData,u as default};
